import React from "react";

interface Header3Props {
  title: string
  alignment?: string
  padding?: boolean
}

export const Header3 = (props: Header3Props) => {
  const { title, alignment, padding } = props;

  return (
    <header className={`justify-${alignment ? alignment : 'center'} flex w-full h-16 text-md xl:text-lg font-bold items-center border-b-2 pl-4 md:pl-20 xl:pl-40 bg-white ${padding && 'pr-4'}`}>
      <p className='uppercase text-center'>
        {title}
      </p>
    </header>
  )
}
